import Link from "next/link";
import React from "react";
import styled from "styled-components";

export default function NavigationBar() {
  return (
    <nav style={navStyle}>
      <Link href="/">
        <Content style={linkStyle}>TOP</Content>
      </Link>

      <Link href="/stock">
        <Content style={linkStyle}>STOCK</Content>
      </Link>

      <Link href="/contact">
        <Content style={linkStyle}>CONTACT</Content>
      </Link>
    </nav>
  );
}

const Content = styled.div`
  margin-right: 15;
  text-decoration: none;
  color: "black";
`;

const navStyle = styled.nav`
  display: flex;
  flex-direction: row;
  justify-content: flex-end;
`;
